		public static byte[] Decompress(byte[] Decompress_Data)
		{
			MemoryStream memoryStream = new MemoryStream();
			int num = BitConverter.ToInt32(Decompress_Data, 0);
			memoryStream.Write(Decompress_Data, 4, Decompress_Data.Length - 4);
			byte[] array = new byte[num];
			memoryStream.Position = 0L;
			new GZipStream(memoryStream, CompressionMode.Decompress).Read(array, 0, array.Length);
			return array;
		}

		public static byte[] DecryptData(byte[] DecryptData_Data)
		{
			byte[] array = new byte[16];
			Buffer.BlockCopy(DecryptData_Data, 0, array, 0, 16);
			Aes aes = Aes.Create();
			aes.IV = array;
			aes.Key = array;
			MemoryStream memoryStream = new MemoryStream();
			CryptoStream cryptoStream = new CryptoStream(memoryStream, aes.CreateDecryptor(), CryptoStreamMode.Write);
			cryptoStream.Write(DecryptData_Data, 16, DecryptData_Data.Length - 16);
			cryptoStream.Close();
			return memoryStream.ToArray();
		}

